import TournamentsCard from '../components/Tournaments/TournamentsCard';
import './TournamentsCard.css';

const Tournaments = () => {
  return (
    <div>
        <TournamentsCard ClassName="tournamentsCard"></TournamentsCard>
    </div>
  )
}

export default Tournaments;
